import React from "react";

const Senti = () => {
  return (
    <div className="flex justify-center items-center mt-10">
      <input type="text" placeholder="Enter Youtube Link" className="p-2 mr-2 "/>
      <button className="bg-blue-700 p-2 text-white rounded-full">Submit</button>
    </div>
  );
};

export default Senti;
